import React, { Component } from 'react';
import './sellcss.css';
class startpage extends Component {
   
    styles=
    {
        'box':{'background-color':'brown','width':100,'hieght':100},
        'text':{'color':'pink'}
    };
    render() {
        return (
            <div className="box">
            <h1 className="text">hi hello</h1>
            <button>hello</button>
            </div>
        );
    };

}
export default startpage;
